import { Routes, Route } from "react-router-dom";
import React, { useState } from 'react';
import './App.css';
import Login from "./page/Login.js";

function App() {
    return (
        <div>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="login" element={<Login />} />
            </Routes>
        </div>
    );
}

export default App;
